import React, { useState } from 'react'
import {Nav, Navbar, Button} from 'react-bootstrap';
import PropertyFormModal from './AddForm';


const SellerNavbar = () => {
  const [showAddModal, setShowAddModal] = useState<boolean>(false);
  const handleShowAddModal = () => setShowAddModal(true);
  const handleCloseAddModal = () => setShowAddModal(false);

  return (
    <>
    <Navbar bg="dark" variant="dark">
        <div className='container'>
        <Navbar.Brand href="#home" className="ms-2">Rentify</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end" >
          <Nav className="ml-auto me-2">
            <Button variant="outline-light" onClick={handleShowAddModal}>
              Add Property
            </Button>
          </Nav>
          <PropertyFormModal show={showAddModal} handleClose={handleCloseAddModal} />
        </Navbar.Collapse>
        </div>
      </Navbar>
    </>
  )
}

export default SellerNavbar
